import React, { Component } from 'react'
import './App.css';

export class ListOfPeople extends Component {
    constructor(props){
        super(props)
        this.state = {
            personData : this.props.info
        }
    }

    
    render() {
    console.log(this.state.personData)

        return (
            <div>
                <table className = 'user-info'>
                   <thead>
                   <tr>
                      <th>Name</th>
                      <th>Email</th>
                      <th>Age</th>
                    </tr>
                   </thead>
                    {
                      this.props.list.map(user =><tbody key = {user._id}>
                                                <tr>
                                                  <td>{user.name}</td>
                                                  <td>{user.email}</td>
                                                  <td>{user.age}</td>
                                                  <td><button>Edit</button></td>
                                                  <td><button >Delete</button></td>
                                                </tr>
                                          </tbody>)
                    }

                  </table>
                
            </div>
        )
    }
}

export default ListOfPeople
